import './App.css';
import Head from "./components/head/head.js";

function App() {
  return (
    <div className="App">
      <div className="wrapper">
        <div className="container">
          <div className="grid_head">
            <Head/>
          </div>
          <div className="grid_main">
          </div>
          <div className="grid_footer">
          </div>
          </div>
        </div>
      </div>
  );
}

export default App;
